import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";

const Header = (props) => {
  return (
    <div className="Header">
      <header>
        <nav>
          <Link hrefLang="" linkto="">Home</Link>
          <a linkTo="EventsType">Tipo Eventos</a>
          <a link="EventsPage">Eventos</a>
          <a link="Login">Login</a>
        </nav>
      </header>
    </div>
  );
};

export default Header;
